sys_variable_value.value:
(function execute(inputs, outputs) {

    // Expecting inputs.objects to be an array of JSON strings or objects
    var objects = inputs.objects;
    var merged = {};

    // Ensure we can handle both GlideList or Array inputs
    if (typeof objects === 'string') {
        try {
            objects = JSON.parse(objects);
        } catch (e) {
            outputs.status = "error";
            outputs.error_message = "Invalid JSON array input";
            outputs.result = "{}";
            return;
        }
    }

    // Loop through each object
    for (var i = 0; i < objects.length; i++) {
        var obj = objects[i];

        // Convert string to JSON if needed
        if (typeof obj === 'string') {
            try {
                obj = JSON.parse(obj);
            } catch (e) {
                 outputs.status = "error";
                    outputs.error_message = "Invalid JSON at index " + i;
                continue;
            }
        }

        // Loop through each key in the current object
        for (var key in obj) {
            if (obj.hasOwnProperty(key)) {
                var value = parseFloat(obj[key]) || 0;

                if (merged.hasOwnProperty(key)) {
                    merged[key] += value; // add if exists
                } else {
                    merged[key] = value;  // create if new
                }
            }
        }
    }

    // Return merged object result as JSON string
    outputs.result = JSON.stringify(merged);

})(inputs, outputs);

